import Image from "./Image";

export default function ProductImg({product, index = 0, className = null}) {
    if (!product.main_image_url) {
        return '';
    }
    if (!className) {
        className = 'h-3/5 w-full';
    }
    return (
        <Image className={className} src={product.main_image_url} alt="" />
    )
}
